import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  display: flex;
  
  .qwer {
    text-aline: center;
  }
`;

const Summary = (props) => {
  return <>
  <Wrapper>
    <img src="assets/images/summary.png" alt="img" />
    <div className="qwer">
      <h1>qwer</h1>
      <h1>asdf</h1>
    </div>
  </Wrapper>
    
  </>;
};

export default Summary;
